import React from 'react';
import ReactDOM from 'react-dom';

const tasks = ['Get up early in the morning', 'Go to Gym', 'Start your day'];

const element = <ol>
    {tasks.map((task) => <li>{task}</li>)}
    <li>{tasks[0]}</li>
    <li>{tasks[1]}</li>
    <li>{tasks[2]}</li>
    </ol>


ReactDOM.render(element, document.getElementById('root'));
